/***********************************************/
/*       DATA TYPES                            */
/***********************************************/

/*  Operand definition -- used in building     */
/*  format table                               */

struct lx_bitfield
{
  int size;           /* number of bits            */
  int from_offset;    /* Offset in abstract value. */
  int to_offset;      /* Offset in encoded value.  */
};

typedef struct lx_bitfield lx_bitfield_t;

struct lx_operand
{
  char *tname;                                   /* operand type name     */
  int type;                                      /* type of operand       */
  int width;                                     /* Width of the operand. */
  int rightshift;                                /* scaling amount        */
  int flags;                                     /* Can be SIGNED|CANEXTEND|BITMASK */
  int bitfields;                                 /* Number of given bitfields */
  lx_bitfield_t bfield[];  /* bitfields in most to least significant order. */
};

typedef struct lx_operand lxbfield;

/* some flags for lx_operand                                 */
/* lxSIGNED    : is this operand treated as signed ?         */
/* lxCANEXTEND : can this operand have an extension syllable */
/* lxBITMASK   : this operand is a bit mask */

#define lxSIGNED    1
#define lxCANEXTEND 2
#define lxBITMASK   4

#define lxOPCODE_FLAG_UNDEF   	0

/* Opcode definition.                          */

struct lx_codeword_s {
  unsigned int       opcode;                      /* the opcode                     */
  unsigned int       mask;                        /* disassembly mask               */
  unsigned int       flags;                       /* Target dependent flags.        */
};

typedef struct lx_codeword_s lx_codeword_t;

struct lxopc_s {
  char               *as_op;                        /* asm name                       */
  lx_codeword_t codeword[LXMAXCODEWORDS];   /* 32 bits code words.         */
  unsigned           codewords;                     /* Number of 32 bits code words.  */
  unsigned           coding_size;                   /* coding size in case of variable length. */
  int                bundlings;                     /* user specific flags            */
  int                reservation;                   /* reservation table index        */
  lxbfield *format[LXMAXOPERANDS + 1];  /* 0 terminated                   */
                                        /* list of operands               */
  char     *rclass;                     /* resource class                 */
  char     *fmtstring;                  /* formating string               */
};
typedef struct lxopc_s lxopc_t;

struct lx_core_info_s
  {
    const char *name;
    lxopc_t *optab;
    const int *resources;
    int elf_core;
    int supported;
  };

typedef struct lx_core_info_s Lx_Core_Info;
struct bundletype_s
  {
    int entries;
    int bias, base;
    int nnops;
    Bundling bundling[LXMAXBUNDLESIZE];
    int nops[LXMAXBUNDLESIZE];
  };

typedef struct bundletype_s BundleType;

struct bundlematchtype_s { int entries; int entry[4]; };

typedef struct bundlematchtype_s BundleMatchType;

